INSERT INTO `t_messages` (`ID`, `Pseudo`, `Message`, `FK_Forum`, `IP`, `USER_AGENT`, `Post_date`, `Deleted`) VALUES
(1, 'wallah tes trop fort', 'Juste pour dire grace a toi jaurai 4 au moins avec favre bulle jtm mec', 1, '213.55.176.245', NULL, '2019-01-06 17:11:26', 0),
(2, 'Yannis', 'Euh merci. lol je m\'attendais pas à ça comme premier message mais c\'est pas grave ; )', 1, '192.168.192.17', NULL, '2019-01-06 17:45:48', 0),
(3, 'Yannis', 'Juste, t\'es qui ?', 1, '192.168.192.17', NULL, '2019-01-06 17:50:09', 0),
(4, 'Un écolier raisonnable ', 'Merci c\'est tlm mieux que Favre bulle ', 2, '194.230.158.123', NULL, '2019-01-07 08:43:43', 0),
(5, 'Yannis', 'Oui y a pas de problème, j\'étais pas sûr que tout soit très claire.<br />\nDonc si t\'as des idées ou autres, n\'hésite pas ; )', 2, '80.219.218.24', NULL, '2019-01-07 08:46:33', 0),
(6, 'anonimous', 'comment on trouve le nom de sous réseau ? car la on trouvev 5 mais j\'ai pas compris comment ', 3, '62.2.245.123', NULL, '2019-01-07 09:42:38', 0),
(7, 'Yannis', 'C\'est le nombre de sous-réseaux maximum que tu peux avoir et tu rajoute 10%.<br />\r\nOn fait un arrondi supérieur donc 4 + 10% = 4 + 0.4 = 4.4 -&gt; 5', 3, '80.219.218.24', NULL, '2019-01-07 09:50:18', 0),
(8, 'le petit fou ', 'il s\'appel alexandre da silva et il est dans la classe 1A', 1, '62.2.245.123', NULL, '2019-01-07 10:00:48', 0),
(9, 'paulette', 'et comment on voit pour faire la liste des sous reseau comment fait-on ?', 3, '62.2.245.123', NULL, '2019-01-07 10:05:04', 0),
(10, 'Yannis', 'Tu dois tester chaque possibilité pour les bits du sous-réseau :<br />\r\n<br />\r\nSi tu as une structure comme ça par exemple :<br />\r\nS = Bit sous-réseau<br />\r\nH = Bit host<br />\r\n<br />\r\nSSSHHHHHH<br />\r\n00000000<br />\r\n00100000<br />\r\n01000000<br />\r\n01100000<br />\r\n10000000<br />\r\n10100000<br />\r\n11000000<br />\r\n11100000<br />\r\n<br />\r\nTu convertis ça en binaire et n’oublie pas de supprimer le premier et le dernier qui ne sont pas supportés par la RFC-950.', 3, '80.219.218.24', NULL, '2019-01-07 10:19:50', 0),
(11, 'je suis un abruti', 'je comprend tjrs pas comment on doit procéder<br><img src=\"uploads/Microsoft Edge_2019-01-07_11-28-19.png\" alt=\"Microsoft Edge_2019-01-07_11-28-19.png\">', 3, '62.2.245.123', NULL, '2019-01-07 10:32:43', 0),
(12, 'Yannis', 'Dans une adresse, t’as un nombre de bits qui sont utilisé pour le sous-réseau et un nombre de bits pour l’host.<br />\r\n<br />\r\nPour calculer tous les sous-réseaux, tu dois construire chaque combinaison possible avec les bits de sous-réseau.<br />\r\n<br />\r\nSi t’as une adresse avec 3 bits pour le sous-réseau et 5 bits pour l’host :<br />\r\nSSSHHHHH<br />\r\n<br />\r\nTu remplaces SSS par toutes les valeurs possibles :<br />\r\n000HHHHH<br />\r\n001HHHHH<br />\r\n010HHHHH<br />\r\n011HHHHH<br />\r\n100HHHHH<br />\r\n101HHHHH<br />\r\n110HHHHH<br />\r\n111HHHHH<br />\r\n<br />\r\nEt les H ils sont à 0 car c’est l’adresse du sous-réseau.<br />\r\n<br />\r\n<br />\r\nMais il ne faut pas oublié de supprimer le premier (000) et le dernier (111) sous-réseau car la RFC-950 ne les prends pas en charge.', 3, '80.219.218.24', NULL, '2019-01-07 10:52:46', 0),
(13, 'merci', 'j\'ai compris merci beaucoup', 3, '62.2.245.123', NULL, '2019-01-07 12:15:16', 0),
(14, 'Damien', 'Bonjour, comment savons nous combien de bits sont pout l\'host et pour le sous reseau ?', 4, '62.2.245.123', NULL, '2019-01-07 12:46:08', 0),
(15, 'Yannis', 'nombre de bits sous-réseaux =  ln(nombre de sous-réseaux + 2) / ln(2)<br />\r\nnombre de bits host =  ln(nombre de machines + 2) / ln(2)', 4, '80.219.218.24', NULL, '2019-01-07 13:17:53', 0),
