(174, 'Yannis', 'Rajoute ça en bas de ta page HTML :<br />\r\n<pre>&lt;script&gt;\r\n&nbsp;&nbsp;&nbsp;&nbsp;document.getElementById(&quot;IdDeTonFormulaire&quot;).onkeypress = function(e) {\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;var key = e.charCode || e.keyCode || 0;\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;if (key == 13) {\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;e.preventDefault();\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\r\n&nbsp;&nbsp;&nbsp;&nbsp;}\r\n&lt;/script&gt;</pre>\r\nEt remplace IdDeTonFormulaire par l\'ID de ton formulaire.', 39, '109.164.215.100', NULL, '2019-05-10 12:48:53', 0),
(175, 'ARO :D', 'Coucou le peuple,<br />\r\n<br />\r\nInstallation du rôle : dans le gestionnaire de serveur, ajouter le rôle &quot;Serveur DNS&quot;, valider les fonctionnalités.<br />\r\nDans la console DNS, sur votre serveur indiquez les redirecteurs DNS de votre FAI.<br />\r\nDans la configuration de votre carte réseau dans la section DNS (point 7 de l\'image plus haut) déclarez votre adresse IP statique.<br />\r\nET surtout ne jamais mettre un serveur DNS en mode client DHCP ! c\'est le mal !!!<br />\r\n<br />\r\nPS. Les fautes d\'orthographes sont copyright :)<br />\r\n<br />\r\nAmicalement ARO<br />\r\n', 27, '193.5.240.1', NULL, '2019-05-13 13:08:15', 0),
