(192, 'Nicolas', 'Salut Yannis ça joue ? j\'aurai juste une question ? <br />\r\nSais-tu faire des drop list avec les valeur d\'une table (exemple : j\'aimerai ajouter des sexe a mes participants rt j\'aimerai bien faire une liste deroulante pour pouvoir en choisir que un) voila tou merci d\'avance et bon week ;)', 46, '62.2.245.123', 'Mozilla/5.0 (Windows NT 10.0; WOW64; Trident/7.0; Touch; rv:11.0) like Gecko', '2019-05-24 11:54:47', 0),
