(208, 'YESMAN', 'Le mot « pirate » vient du latin pirata1 (« celui qui tente la fortune, qui est entreprenant ») − attesté depuis Cicéron −, qui s\'est imposé devant le terme praedo maritimus. Pirata est un emprunt au grec πειρατής (peiratês), c\'est-à-dire « brigand, bandit qui court les mers pour attaquer les navires », mot avec spécialisation de sens dérivé du verbe πειράω (peiraô) signifiant « s\'efforcer de », « essayer de », « tenter sa chance à l\'aventure »2. Cicéron déclare les pirates de l\'Antiquité « ennemis communs à tous » (communis hostis omnium) car ils échappent aux catégories habituelles du droit3. Au Moyen Âge, la signification du terme « pirate » se restreint pour désigner plus spécifiquement des bandits qui parcourent les mers pour piller des navires marchands.<br />\r\n<br />\r\nLes pirates se distinguent des corsaires qui sont des civils faisant la guerre sur mer avec l\'autorisation de leur gouvernement (grâce aux lettres de marque), selon les lois de la guerre, avec un statut équivalent aux militaires mais sans être soumis à l\'autorité d\'un état-major et au contraire d\'une façon indépendante. La confusion entre pirates et corsaires résulte de plusieurs faits : jusqu\'à la fin du Moyen Âge, les termes de corsaire et pirate, synonymes, étaient employés indifféremment (pour les distinguer, il faut qu\'un État souverain délivre une lettre de marque - or l’État souverain n\'apparaît en Europe qu\'au cours des xvie et xviie siècles4) ; les Corsaires faisaient la guerre aux nations ennemies en s\'attaquant à leur commerce mais, sans ressources en temps de paix, ils devenaient pirates (comme Francis Drake ou Jean Ango)5. Cette apparence ne doit pas faire oublier qu\'ils respectaient en général les vies et les biens personnels ; seul le navire et le fret faisaient l\'objet de la prise, une enquête établissait si la prise avait été légitime et le bien était rendu si tel n\'avait pas été le cas. Notons toutefois qu\'un corsaire autorisé par un État particulier était qualifié de pirate par les États ennemis. Tout corsaire, donc, est un pirate du point de vue d\'un État tiers. L\'épisode de la prise du navire portugais Santa Catarina en 1603 par un corsaire hollandais, accusé de piraterie par les Portugais, illustre bien l\'ambiguïté de la distinction entre corsaire et pirate - cet incident diplomatique est d\'ailleurs à l\'origine de la rédaction par le célèbre juriste Hugo Grotius du traité sur « La Liberté des Mers »6. Anne Pérotin-Dumon résume bien la situation en écrivant que « savoir si quelqu\'un ou non doit être qualifié de pirate est une question dont la réponse appartient à celui qui a le pouvoir »7.<br />\r\n<br />\r\nLa piraterie a connu plusieurs périodes fastes, à la fin du ier siècle av. J.-C. en Méditerranée, et au xviiie siècle dans les Antilles et l’Océan Indien puis peu à peu disparu de ces régions, du fait du quadrillage des marines d\'État. Le mot pirate est utilisé aussi dans différents contextes autres que maritime : le « pirate de la route », que l\'on appelait autrefois « voleur de grand chemin », le « pirate informatique », qui désigne un individu s\'introduisant illégalement dans un système informatique. On parle parfois de « pirates » dans le cas de détournement d\'avions : c\'est le cas des pirates de l\'air. Toutefois, il s\'agit ici d\'une déformation du sens de pirate car il s\'agit d\'actions terroristes, politiques et non de crimes de droit commun. Plus récemment, on évoque le cas des « biopirates », qui manipulent le vivant en dehors de tout cadre légal, souvent dans des laboratoires clandestins, afin de modifier certaines caractéristiques des espèces vivantes ou d\'en créer de nouvelles8. Alors que le Moyen Âge et l\'époque moderne ont repris une formule de Cicéron selon laquelle le pirate est « l\'ennemi commun à tous », la Convention des Nations unies sur le droit de la mer a donné en 1982 une définition plus restrictive du pirate qui est selon le droit international un criminel de droit commun intervenant en haute mer à partir d\'un bâtiment9.', 50, '194.209.6.201', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/75.0.3770.100 Safari/537.36', '2019-06-21 13:30:08', 0),
