(226, 'Nouveau', 'Salut,<br />\r\nC\'est possible de faire une formulaire tout en un sur access ?', 54, '178.83.170.197', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/78.0.3904.108 Safari/537.36', '2019-12-06 10:42:34', 0),
(227, 'Yannis', 'Pas vraiment. Parce que le but de faire plusieurs tables, c\'est justement de pouvoir lier des enregistrements ensembles (1, n) et (n, n). Et si tu n\'as qu\'un seul formulaire, tu ne pourras faire que du (1, 1).<br />\r\nMais au final, ton formulaire comportera des bouton qui permettrons d’accéder aux autres formulaires. Donc niveau fonctionnel, ça revient au même.', 54, '77.58.89.33', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64; rv:71.0) Gecko/20100101 Firefox/71.0', '2019-12-06 12:54:36', 0),
(228, 'Nouveau', 'Ok  merci.<br />\r\nMais du coup niveau affichage c\'est quoi l\'idéal pour que ce soit le plus compréhensible possible si j\'ai un F_Personne un F_Telephone et un F_avoir_Telephone.<br />\r\nJ\'ai un peu de peine à comprendre l\'utilité d\'avoir un formulaire de liaison pour l\'utilisateur, je sais pas si tu vois ce que je veux dire ?<br />\r\nJ\'aime quand c\'est propre et j\'aimerais que ma base soit utilisable par une grand mère de 80 ans et que tout soit accessible/compréhensible facilement mais je vois pas trop comment faire.<br />\r\nMerci pour ton aide ', 54, '178.83.170.197', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/78.0.3904.108 Safari/537.36', '2019-12-06 13:24:10', 0),
(229, 'Yannis', 'Oui maintenant je comprends ce que tu veux dire.<br />\r\nLes formulaires de liaison seront remplacé par une liste avec du VBA dans les prochaines semaines.<br />\r\nJe l\'explique plus ou moins ici : https://prog.normalux.ch/access/control_zone_liste.php<br />\r\nMais je suis pas sûr que ce soit super compréhensible donc ne t\'attarde pas trop sur ça pour l\'instant.', 54, '77.58.89.33', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64; rv:71.0) Gecko/20100101 Firefox/71.0', '2019-12-06 14:13:05', 0),
(230, 'Alex', 'Salut<br />\r\nJe suis en première et je dois bientôt rendre ma db acces mais j\'ai pige pas un truc<br />\r\nMaccaud demande des Sous Formulaires intermédiaires par exemple : j\'ai une table T_telephone j\'ai donc une table intermédiaire T_posseder_Telephone  mais je sais pas quoi faire de ma table intermédiaire lorsque je la passe en formulaire.<br />\r\nJe comprends que c\'est pour ajouter plusieurs téléphone mais je comprends pas comment l\'utiliser en formulaire <br />\r\nc\'est pas très clair j\'espère que tu comprendras, j\'espère que tu pourras m\'aider car c\'est un peu abstrait pour moi merci de ton aide et bonnes fêtes !', 55, '83.78.250.232', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/79.0.3945.88 Safari/537.36', '2019-12-28 17:00:20', 0),
(231, 'Yannis', 'Salut,<br />\r\nJe pense que dans un premier temps, il te faut juste essayer de faire l\'ajout de téléphone pour une personne. Pas de suppression, modification, etc.<br />\r\nTu es obligé de le faire en VBA. Je te donne le lien qui parle de ça :<br />\r\nhttps://prog.normalux.ch/access/requetes.php<br />\r\n<br />\r\nBonnes fêtes à toi aussi, et à tous les utilisateurs du sites ; )', 55, '178.83.170.144', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64; rv:71.0) Gecko/20100101 Firefox/71.0', '2019-12-29 09:14:33', 0),
