(236, 'info 1a', 'Enfaite maccaud nous à donné à faire un calculateur d\'âge avec la date de naissance comme sur ta base de donnée à faire.<br />\r\nOn doit la rendre demain et ça ne fonctionne pas je suis dans la cac', 56, '85.1.168.208', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/79.0.3945.117 Safari/537.36', '2020-01-15 11:37:30', 0),
(237, 'Yannis', 'Mais c\'est quoi l\'erreur ?<br />\r\nParce que là j\'ai juste la fonction qui a planté. Mais pas la ligne ni le message d\'erreur.<br />\r\nEt je vois même pas tout ton code alors tu comprends bien qu\'il m\'est difficile de corriger.', 56, '77.58.89.33', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64; rv:72.0) Gecko/20100101 Firefox/72.0', '2020-01-15 12:04:54', 0),
(238, 'info 1a', 'l\'erreur:<br />\r\nErreur de compilation: membre de méthode ou de données introuvable<br />\r\nvoici le code:<br />\r\n\'<br />\r\n\' YB en 2018 Je le remercie ici !!!<br />\r\n\' OM en 2019.12.29 Quelques commentaires utiles pour approcher la pratique du VBA et d\'un algorithme simple.<br />\r\n\' Cette procédure doit se trouver dans le formulaire où il y a le champ &quot;Date_Naissance_Personne&quot;.<br />\r\n\' Comme c\'est une procédure, elle doit être à la fin ou au début du code VBA du formulaire, mais surtout pas dans un événement.<br />\r\n\' L\'avantage de définir une procédure c\'est de pouvoir être appellée plusieurs fois.<br />\r\n\'<br />\r\nPrivate Sub Calculer_Age()<br />\r\n    \' Une déclaration de type pour la variable &quot;Age&quot;<br />\r\n    Dim Age As Integer<br />\r\n    \' Mémorise la date de naissance de la personne du formulaire ouvert<br />\r\n    DateNaiss = Me.Date_Naissance_Personne<br />\r\n    <br />\r\n    \' Si le champ &quot;Date_Naissance_Personne&quot; n\'est pas vide.<br />\r\n    If Not IsNull(DateNaiss) Then<br />\r\n    <br />\r\n        \' Calcul de l\'âge en années.<br />\r\n        Age = fAge(DateNaiss)<br />\r\n        \' Calcul du nombre de mois depuis la date de naissance de la personne.<br />\r\n        AgeMois = AgeMonths(DateNaiss)<br />\r\n        <br />\r\n        \' Si le résultat du calcul de l\'âge donne un nombre plus grand<br />\r\n        \' qu\'&quot;UNE&quot; année, alors on écrit &quot;ans&quot;.<br />\r\n        If Age &gt; 1 Then<br />\r\n            \' La couleur du texte est normale<br />\r\n            Me.Age.ForeColor = DefaultForeColor<br />\r\n            Me.Age.Caption = &quot;(&quot; &amp; Age &amp; &quot; ans)&quot;<br />\r\n            <br />\r\n            \' Si le nombre d\'années est de zéro alors on va écrire le nombre de mois.<br />\r\n        ElseIf Age = 0 Then<br />\r\n                \' La couleur du texte est normale<br />\r\n                Me.Age.ForeColor = DefaultForeColor<br />\r\n                <br />\r\n                \' Si le résultat du calcul de l\'âge donne un nombre égal à zéro<br />\r\n                \' alors on exprime une durée en &quot;mois&quot;.<br />\r\n                Me.Age.Caption = &quot;(&quot; &amp; AgeMois &amp; &quot; mois)&quot;<br />\r\n                <br />\r\n        ElseIf Age &lt; 1 Then<br />\r\n                \' Le résultat négatif du calcul de l\'âge montre que c\'est une date dans le futur.<br />\r\n                \' On avertit &quot;fermement&quot; l\'utilisateur.<br />\r\n                \' On change de couleur pour convaincre l\'utilisateur d\'une &quot;probable&quot; erreur.<br />\r\n                Me.Age.ForeColor = vbRed<br />\r\n                \' La chaîne de caractère doit être la plus explicite possible.<br />\r\n                Me.Age.Caption = &quot;(Pas ENCORE né !)&quot;<br />\r\n        End If<br />\r\n    Else<br />\r\n        \' Si le champ &quot;Date_Naissance_Personne&quot; est vide, il n\'y a pas de raison de calculer l\'âge,<br />\r\n        \' alors il faut garantir qu\'on affiche RIEN dans le contrôle &quot;ETIQUETTE&quot;.<br />\r\n        \' On contraint le contrôle &quot;ETIQUETTE&quot; à afficher une chaîne de caractère vide.<br />\r\n        Me.Age.Caption = &quot;&quot;<br />\r\n    End If<br />\r\nEnd Sub<br />\r\n<br />\r\n', 56, '85.1.168.208', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/79.0.3945.117 Safari/537.36', '2020-01-15 18:11:51', 0),
