(250, 'Yannis', 'Bonjour à tous,<br />\r\n<br />\r\nPetit sondage : j\'aimerais faire des tutos vidéo à poster sur YouTube. Déjà qui est-ce qui serait intéressé ?<br />\r\nSi vous êtes intéressé, quels sujets trouveriez-vous intéressant de traiter en premier ?<br />\r\n<br />\r\nJe préfère rester dans le domaine de la programmation plutôt que du réseau dans lequel je suis moins bon.<br />\r\nJ\'ai déjà quelques idées :<br />\r\n<br />\r\n- Les bases de la programmation (en C# par exemple)<br />\r\nJ\'y parlerais des principes de base de la prog (variables, conditions, fonction, etc.) dans un langage connu comme le C#.<br />\r\n<br />\r\n- La programmation web<br />\r\n1ère partie (côté client) : Présentation de l\'HTML, du CSS et du JavaScript<br />\r\n2ème partie (côté serveur) : Présentation du PHP et des bases de données<br />\r\n<br />\r\n- Les encodages, les formats<br />\r\nJ\'y expliquerais différentes choses comme au module 114.<br />\r\n<br />\r\n- Fonctions avancées d\'Excel<br />\r\nPlutôt formules que VBA, juste parce que j\'aime bien Excel.<br />\r\n<br />\r\n<br />\r\nBien évidemment, je dois aussi bosser mes cours de 2ème année, et les vidéos prendront sûrement du temps à sortir. Pour l\'instant je ne promets rien, je veux juste avoir votre avis sur cette proposition.<br />\r\n<br />\r\nMerci à tous les utilisateurs du site, bonne soirée<br />\r\nY. Burkhalter', 59, '178.83.170.144', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64; rv:72.0) Gecko/20100101 Firefox/72.0', '2020-01-25 18:28:18', 0),
